achievements.en:
3 times British Open Final Qualifying (1991, 1992, 2005);
Omega China Tour (2008) - One of the 10 internatinal players who qualified for the Omega China Tour and achieved 16th in the first tournament in 2008;
Hong Kong Open (2007) - One of the 5 players from Hong Kong who qualified for the Hong Kong Open European Tour;
Hong Kong PGA Order of Merit September 2007 - 3rd place;
International PGA Order of Merit 2005 - 1st place;
Winner of IPGA Masters - 2005;
Winner of IPGA Pro Event - 2003;
7 times winner of PGA Professional Tournaments in S. England (1987-1994)

